const categories = [
  {
    thumbnail: {
      uri: "https://lorempixel.com/200/200/animals",
      name: "animals"
    }
  },
  { thumbnail: { uri: "https://lorempixel.com/200/200/city", name: "city" } },
  { thumbnail: { uri: "https://lorempixel.com/200/200/city", name: "city" } },
