  { thumbnail: { uri: "https://lorempixel.com/200/200/cats", name: "cats" } },
  { thumbnail: { uri: "https://lorempixel.com/200/200/cats", name: "cats" } },
  { thumbnail: { uri: "https://lorempixel.com/200/200/cats", name: "cats" } }
];

function Menu() {
  const [activeIndex, setActiveIndex] = useState(0);

