      sx={{
        gridAutoFlow: "column",
        gridTemplateColumns: "repeat(auto-fit, minmax(160px,1fr)) !important",
        gridAutoColumns: "minmax(160px, 1fr)"
      }}
    >
      {categories.map((image) => (
        
       <Button severity="secondary" rounded className="bg-gray-400	opacity-30">
         <h5 className="font-normal m-2" style={{ color: 'var(--white)' }}>ESPECIALES</h5>
       </Button>
       
      ))}
    </ImageList>


      
      <div className="flex overflow-scroll w-screen gap-2 py-2 mx-4"style={{ height: '200px', overflow: 'scroll' }}>
       
        <Button severity="danger" rounded className='flex-nowrap	'>
          <h5 className="font-normal m-2" style={{ color: 'var(--white)' }}>SUELTOS</h5>
        </Button>
        <Button severity="secondary" rounded className="flex-nowrap	 bg-gray-400	opacity-30">
          <h5 className="font-normal m-2" style={{ color: 'var(--white)' }}>ESPECIALES</h5>
        </Button>
        <Button severity="secondary" rounded className="flex-nowrap	 bg-gray-400	opacity-30">
